import React from 'react';
import { Switch, Route } from 'react-router-dom';
import Home from './pages/home/home';
import AdminDashboard from './pages/dashboard/adminDashboard'; // Ensure correct import path and component name
import RegisterSociety from './pages/forms/registerSociety';
import RegisterSecretary from './pages/forms/registerSecretary';

function App() {
  return (
    <Switch>
      {/* <Route path="/" exact component={Home} /> Render Home component for exact "/" path */}
      <Route path="/" component={AdminDashboard} /> {/* Render AdminDashboard component for "/adminDashboard" path */}
      <Route path="/registerSociety" component={RegisterSociety} />
      <Route path="/registerSecretary" component={RegisterSecretary} />
    </Switch>
  );
}

export default App;
